    let selectedPath = [];
const container = document.getElementById("tree-container");
    const levels = [];

    function sortNaturally(keys) {
      return keys.sort((a, b) =>
        a.localeCompare(b, undefined, { numeric: true, sensitivity: 'base' })
      );
    }

    
function renderLevel(level, data) {
      // Trim path to current level and add placeholder
      selectedPath = selectedPath.slice(0, level);
      selectedPath.push(null);

      // Clear deeper levels
      while (levels.length > level) {
        container.removeChild(levels.pop());
      }

      if (!data || typeof data !== 'object') return;

      const keys = sortNaturally(Object.keys(data));
      if (keys.length === 0) return;

      const column = document.createElement("div");
      column.className = "column";

      for (const key of keys) {
        const folder = document.createElement("div");
        folder.className = "folder";
        folder.textContent = key;

        

folder.onclick = () => {
          // Store selection path
          selectedPath[level] = key;

          // Remove all active-path classes
          document.querySelectorAll(".folder").forEach(f => f.classList.remove("active-path"));

          // Re-add active-path to all selected path items
          for (let i = 0; i < selectedPath.length; i++) {
            const col = container.children[i];
            if (!col) continue;
            [...col.children].forEach(el => {
              if (el.textContent === selectedPath[i]) {
                el.classList.add("active-path");
              }
            });
          }

          // Remove previous active
          document.querySelectorAll(".folder").forEach(f => f.classList.remove("active"));
          // Mark current as active
          folder.classList.add("active");

          renderLevel(level + 1, data[key]);
        };

        column.appendChild(folder);
      }

      container.appendChild(column);
